import React from 'react'


import { Body, InputArea, Title, Input } from './styles'

function Mimimi() {
  return (
    <Body>
      <Title>Exemple</Title>
      <InputArea>
        <Input placeholder="Digite seu mimimi"></Input>
      </InputArea>
    </Body>
  )
}

export default Mimimi
